import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import HomePage from './Pages/HomePage';

function App() {
  return (
  <BrowserRouter>
    <Switch>
      <Route exact path="/" component={ HomePage } />
    </Switch>
  </BrowserRouter>
  )
}

export default App;
